INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 102301, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, 2, 0.0, "アヤネ", 24001, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 102301, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, 1, 2.21, "アヤネ", 24002, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 102301, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, 2, 0.0, "アヤネ", 24003, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 192201, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, 2, 1.99, "アサヒ", 24004, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 192201, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, 1, 2.21, "アサヒ", 24005, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 192201, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, 2, 3.33, "アサヒ", 24006, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 192301, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, 2, 0.0, "部員３", 24007, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 192301, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, 1, 2.68, "部員３", 24008, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 192301, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, 2, 0.0, "部員３", 24009, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 192501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "やった！", 501, 1, 0.0, "", 24010, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 192501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "勝ったよ！", 502, 1, 0.0, "", 24011, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 192501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "いい調子！", 503, 1, 0.0, "", 24012, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 113501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, 6, 5.33, "ミサト", 24013, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 113501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, 1, 6.85, "ミサト", 24014, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 113501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, 1, 3.0, "ミサト", 24015, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 192401, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, 1, 6.11, "ダイチ", 24016, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 192401, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, 1, 6.75, "ダイチ", 24017, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 192401, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, 2, 0.0, "ダイチ", 24018, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 113401, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, 2, 4.52, "ハツネ", 24019, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 113401, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, 2, 3.89, "ハツネ", 24020, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 113401, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, 1, 13.49, "ハツネ", 24021, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 106501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, 1, 3.17, "カヤ", 24022, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 106501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, 1, 4.42, "カヤ", 24023, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 106501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, 6, 2.89, "カヤ", 24024, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (3, 102301, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, 4, 3.71, "アヤネ", 24025, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 192201, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, 2, 5.1, "アサヒ", 24026, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (3, 192301, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, 1, 4.34, "部員３", 24027, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 192501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 0.0, 24, "いい勝負だったよ\nまたやろうね", 521, 1, 0.0, "", 24028, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 113501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, -360.0, 24, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, 1, 5.62, "ミサト", 24029, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 113501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, -360.0, 24, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, 1, 9.58, "ミサト", 24030, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 113501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, -360.0, 24, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, 2, 0.0, "ミサト", 24031, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (1, 113501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, -360.0, 24, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, 2, 9.13, "ミサト", 24032, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (2, 113501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, -360.0, 24, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, 1, 8.27, "ミサト", 24033, 0.0);
